import React from "react";
import Slider from "react-slick";
import Content from '../Content'
import AFL from "../../AFL"
import defaultProps from "react-slick/lib/default-props";

export default function SimpleSlider() {
  var settings = {
    dots: false,
    infinite: false,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1
  };
  return (
    <Slider {...settings}>
      {AFL.map((props) => (
        <Content
          image={props.image}
       />
       ))}
    </Slider>
  );
}
